import styled from 'styled-components';

export const Head5 = styled.h5`
  text-align:   justify;
  margin: 0 15rem 0 15rem;
  text-indent: 4em;
  font-size: 1em;
  font-weight: 200;
  line-height: 1.75;
  padding-bottom: 2rem; 
  @media (max-width: 768px) {
    flex-direction: column;
    font-size: .85em;
    padding:0;
`;
